function Square({ value }){
  function handleClick(){
    console.log('clicked!');
  }

  return (
    <button 
      className="square"
      onClick={handleClick}
      ></button>
  )
  return <button className="square">{value}</button>;
}

export default function Board() {

  return (
    <>
      <div className="board-row">
        <Square value="1" />
        <Square value="2"/>
        <Square value="3"/>
      </div>

      <div className="board-row">
        <Square value="3"/>
        <Square value="4"/>
        <Square value="6"/>
      </div>

      <div className="board-row">
        <Square value="7"/>
        <Square value="8"/>
        <Square value="9"/>
      </div>
    </>
  );
}
